import web3 from './web3';
import ElectionFactory from '../Build/ElectionFactory.json';

console.log('Election Factory is being initialized...');
const instance = new web3.eth.Contract(
    JSON.parse(ElectionFactory.interface),
    '0x16795911522115Ef7D4F099f1aBe1F76C2dB6AC8'
);

console.log('Election Factory initialized at address:', instance.options.address);

export default instance;
